Simulateur::Simulateur()
{
    idxFrame=0;
}

qint64 Simulateur::readData(char *data, qint64 maxSize) {
    qint64 size = this->rxData.length();
    if (size>maxSize) size=maxSize;
    memcpy(data,this->rxData.constData(),size);
    rxData.remove(0,size);
    return size;
}

qint64 Simulateur::writeData(const char *data, qint64 maxSize) {
    this->txData.append(data,maxSize);
    this->simulateRobot();
    return maxSize;
}

bool Simulateur::open(OpenMode mode) {
    rxData.remove(0,rxData.length());
    return QIODevice::open(mode);
}

bool Simulateur::isSequential() {
    return true;
}

void Simulateur::dataToRead(const char *data, qint64 size) {
    this->rxData.append(data,size);
    emit readyRead();
}

void Simulateur::dataToRead(QByteArray &data)
{
    dataToRead(data.constData(),data.length());
}

qint64 Simulateur::bytesAvailable() const {
    return this->rxData.length();
}


quint64 Simulateur::dataWriten(char *data, qint64 maxSize) {
    qint64 size = this->txData.length();
    if (size>maxSize) size=maxSize;
    memcpy(data,this->txData.constData(),size);
    txData.remove(0,size);
    return size;
}

QByteArray Simulateur::dataWriten()
{
    QByteArray data = txData;
    txData.clear();
    return data;
}

